import { useEffect } from "react"
import { LoginForm } from "../components/ui/Login"

export function Home() {

    useEffect(() => {
        fetch('/users')
            .then(res => res.text())
            .then(data => console.log(data))
    }, [])

    return (
        <>
            <LoginForm />
        </>
    )
}
